- input: "TEXT\x1CC00024372\x1CTEXT-00001\x1C\x1CF3XA\x1CThis report is being amended
    in response to the Commission's request, dated September 30, 2009.    1.  The
    receipt on Scheduel A from Pa O'Brien for Secretary of State was improperly listed
    as a contribution.  This was actually the purchase of Voter File Access and it
    has now been corrected.     2.  The negative disbursement of Schedule B for -$3,533.18
    was for a balance adjustment.  The balance adjustment resulted from a corrective
    measure the Committee took several cycles ago.  It was discovered during this
    period that this transaction from 2003 was incorrectly reported and needed to
    be removed.  The Committee consulted with the Commission and was advised to create
    this entry to correct the balance, rather than amend every report from the last
    6 years.  With this adjustment in June, the balance is now correct.  This report
    includes Memo Schedule A entries for contributions raised by the ASDC Partnership
    program and Dollars for Democrats.  The committee has not received its share of
    the proceeds as of the end of the reporting period.  The committee expects to
    receive the transfer at some point in the three months following this reporting
    period.    Any payroll related items on Schedule H4 were for employees that did
    not spend over 25% of their compensated time on federal activity.  Any events
    or fundraising activity was for the benefit of the Committee and did not support
    a federal candidate.\n"
